import Contact from "./Contact";
import "./styles/"

const App = () => {
  const contacts = [
    {
      name: "rajan",
      num: "985",
      location: "Nepal",
    },
    {
      name: "mahesh",
      num: "982567",
      location: "Japan",
    },
    {
      name: "aaku",
      num: "98256788",
      location: "Nepal",
    },
  ];
  return (
    <>
      <div className=".container">
        <h3>Contact List:</h3>
      </div>
      <div className="contact">
        <Contact data={contacts[0]} />
        <Contact data={contacts[1]} />
        <Contact data={contacts[2]} />
      </div>
    </>
  );
};

export default App;
